import { List } from 'antd';
import { parseJsonByString } from '../../../common/utils';
import Article from './component/Article';
import Banner from './component/Banner/';
import Footer from './component/Footer';

const pageSchema = parseJsonByString(window.localStorage.schema, {});
const children = pageSchema.children || [];
const map = { Banner, Footer, Article };


const render = (item, index) => {
  const Component = map[item.name];
  return Component ? <Component key={index} schema={item}></Component> : null;
}

const Home = () => {
  return (
    <div>
      {
        children.map((item, index) => {
          return (render(item, index));
        })
      }
    </div>

  );
}

export default Home;
